    false,nt"url": null,nt"notes": "This paper ascertains what the USFWS can
    do to help stem the downward trend of the southeastern Alaska salmon fishery by:
    reviewing biological aspects of Alaska salmon and describing salmon management options
    and Federal programs and kinds of economic aid available to southeast Alaska natives.
    The respective management roles of the State of Alaska and other federal partners
    are discussed, as well as the current and proposed USFWS fisheries programs designed
    to enhance the economic well-being of Alaska's southeast natives.",nt"owner_org":
